import { Column } from "./Table";


export interface WordInfo {
  id: string;
  word: string;
  translation: string;
  frequency: number;
  createdAt: Date;
}

export interface UserInfo {
  name: string;
  surname: string;
  age: number;
  createdAt: Date;
}



export const words: WordInfo[] = [
  { id: "1", word: "to realy", translation: "полагаться", frequency: 8, createdAt: new Date(2022, 2, 3) },
  { id: "3", word: "to doubt", translation: "сомневаться", frequency: 15, createdAt: new Date(2021, 6, 23) },
  { id: "4", word: "to suspect", translation: "подозревать", frequency: 5, createdAt: new Date(2022, 10, 8) },
  { id: "6", word: "by the way", translation: "кстати", frequency: 1, createdAt: new Date(2021, 11, 4) },
]

export const columnsWord: Column<WordInfo>[] = [
  {title: "Word", render: w => w.word},
  {title: 'Translation',render: w => w.translation},
  {title: "Frequency",render: w => w.frequency.toString(),},
  {title: "Date", render: w => w.createdAt.getFullYear() + '.' + w.createdAt.getMonth() + '.' + w.createdAt.getDay(),}
]

export const users: UserInfo[] = [
  { name: 'Jhon', surname: 'Jonson', age: 20, createdAt: new Date(2021, 5, 7) },
  { name: 'Alex', surname: 'Alexov', age: 30, createdAt: new Date(2022, 10, 18) },
  { name: 'Dima', surname: 'V', age: 25, createdAt: new Date(2019, 6, 9) },
  { name: 'Alice', surname: 'C', age: 18, createdAt: new Date(2022, 12, 27) },
]

export const columnsUser:Column<UserInfo>[] = [
  {title:'Name', render:x=>x.name}
]
